import React from "react";
import styled from "styled-components";


const PossibleSlot = ({onClick, index, time}) => {
    return (
        <button onClick={onClick} key={index} value={time}>possible</button>
    );
}

const ImpossibleSlot = ({onClick, index, time}) => {
    return (
        <button onClick={onClick} key={index} value={time}>impossible</button>
    );
}

export { PossibleSlot, ImpossibleSlot };
